var certificateModule = (function(){

    return {
        generateCertificate: function(data){
            var imgData = 'data:image/png;base64,';
            
            //create doc
            var doc = new jsPDF();
            
            //add img
            doc.addImage(imgData,'PNG',15,40,180,140);
            //add title 
            
            //add text 
            doc.setTextColor(96,96,96);
            doc.setFontSize(20);
            doc.setFont('helvetica')
            doc.setFontType('bold')
            doc.text(105,90,'This Certificate is Awarded to:','center');
            //add name 
            var button = event.target;
            var namefield = button.parentElement.previousElementSibling.children[1].children[1];
            var name = namefield.value;
            doc.setTextColor(96,96,96);
            doc.setFontSize(25);
            doc.text(105,105,name,'center');
            //add text 

            var level = event.target.getAttribute ('level');
            doc.setTextColor(96,96,96);
            doc.setFontSize(20);
            doc.text(105,121,'Level:' + ' '+level,'center');
            doc.text(105,130,'Average Speed: '+ data.wpm +' wpm','center');

            doc.text(105,139,'Accuracy: '+ data.accuracy +'%','center');

            //add result and data
            doc.setFontSize(15);
            var date = new Date();
            date = date.toLocaleDateString('en-US');
            doc.text(25,161,'Awarded on: '+date,'left');
            doc.text(25,170,'Awarded by 2018','left');
            //save document
            doc.save('certificate.pdf');
            // You'll need to make your image into a Data URL

            


        }

    };
})();    